import styles from "./Nav.modules.css"

function Nav ({items}){

    return (
        <ul className={styles.navList}>
            {
                items.map((item, key)=>{
                    return <li key={key} className={styles.navItem}>{item}</li>
                })
            }
        </ul>
    )
}

export default Nav;
